import './App.css';
import { Header } from './component/header/Header';
import {Router,Routes,Route} from 'react-router-dom';
import Body from './component/body/Body';
import { BodyModal } from './component/body/Bodymodal';


function App() {

  return (
    <div className="App">
     <Router>
      <Routes>
        <Route path='/' element={<Header/>}/> 
      </Routes>
     </Router>
    </div>
  );
}

export default App;
